import React from 'react';
import './../../styles/_SignUp.scss';

const SignUp = (props) => {
    const buttonStyle = {
        color: '#000454', 
        backgroundColor: props.Background
    }
    return (
        <div className="dropdown">
            <button
                id="sign-up-button" 
                className="btn btn-lg font-weight-semi-bold mx-2 ml-sm-0 px-5 text-primary"
                style={buttonStyle}>

                Sign up

            </button>
        </div>
    );
}

export default SignUp;
